import{_ as a,c as e,o as t,a3 as r}from"./chunks/framework.zGi9i9Bf.js";const o="/ProgramLearnNotes/assets/640.DjFumJRF.webp",s="/ProgramLearnNotes/assets/640-1714647365038-1.CCHn26dp.webp",i="/ProgramLearnNotes/assets/640-1714647365039-2.DPRXJnE1.webp",p="/ProgramLearnNotes/assets/640-1714647365039-3.86fShGTp.webp",n="/ProgramLearnNotes/assets/640-1714647365039-4.Bkj8kEas.webp",l="data:image/webp;base64,",h="/ProgramLearnNotes/assets/640-1714647365040-6.DQwTN11R.webp",c="/ProgramLearnNotes/assets/640-1714647365040-7.c2LLGQo4.webp",u="/ProgramLearnNotes/assets/640-1714647365040-8.HnT45hdJ.webp",w=JSON.parse('{"title":"打造一个花里胡哨的 Github 个人主页","description":"","frontmatter":{},"headers":[],"relativePath":"Document/开源相关/打造一个花里胡哨的Github个人主页.md","filePath":"Document/开源相关/打造一个花里胡哨的Github个人主页.md","lastUpdated":1716911949000}'),b={name:"Document/开源相关/打造一个花里胡哨的Github个人主页.md"},d=r('<h1 id="打造一个花里胡哨的-github-个人主页" tabindex="-1">打造一个花里胡哨的 Github 个人主页 <a class="header-anchor" href="#打造一个花里胡哨的-github-个人主页" aria-label="Permalink to &quot;打造一个花里胡哨的 Github 个人主页&quot;">​</a></h1><h2 id="_1、介绍" tabindex="-1">1、介绍 <a class="header-anchor" href="#_1、介绍" aria-label="Permalink to &quot;1、介绍&quot;">​</a></h2><p>今天介绍下 <code>GitHub</code> 的一项特色功能 - <code>GitHub profile</code>，以及一些列开源工具、项目来帮助打造自己特色的 <code>GitHub profile</code>。</p><p><code>GitHub profile</code> 也是最近两年 <code>GitHub</code> 才新加的功能，开发者可以通过编写 <code>README</code> 打造属于自己的个人 <code>GitHub</code> 首页。</p><p>先贴一张我自己的</p><p><img src="'+o+'" alt="图片"></p><p>GitHub profile 表示个人主页，但是 Github 近两年悄悄上线了 profile 仓库的功能，也就是说可以自由管理你 profile 的 README</p><p><strong>一句话总结：你可以通过 README.md 来自定义你 Github 首页</strong></p><h2 id="_2、使用" tabindex="-1">2、使用 <a class="header-anchor" href="#_2、使用" aria-label="Permalink to &quot;2、使用&quot;">​</a></h2><p>官方说明文档：<a href="https://docs.github.com/zh/account-and-profile/setting-up-and-managing-your-github-profile/customizing-your-profile/managing-your-profile-readme" target="_blank" rel="noreferrer">https://docs.github.com/zh/account-and-profile/setting-up-and-managing-your-github-profile/customizing-your-profile/managing-your-profile-readme</a></p><p>整体使用很简单，分以下几步</p><p>1.创建一个同名仓库 2.引用模板 3.为内容添加有趣模块</p><h3 id="_2-1、创建一个同名仓库" tabindex="-1">2.1、创建一个同名仓库 <a class="header-anchor" href="#_2-1、创建一个同名仓库" aria-label="Permalink to &quot;2.1、创建一个同名仓库&quot;">​</a></h3><p><img src="'+s+`" alt="图片">图片创建同名仓库</p><p>1.在任何页面的右上角，选择 ，然后单击“新建存储库”。2.在“Repository name（仓库名称）”下，输入与您的 GitHub 用户名匹配的仓库名称。例如，如果您的用户名是 &quot;octocat&quot;，则仓库名称必须为 &quot;octocat&quot;。3.选择“Public”。4.选择“使用 README 初始化此存储库”。</p><p>profile 属于彩蛋类功能，创建时在下方将会出现提示。如果勾选自动创建 README，将会创建一个特殊的 README 模版，长这样：</p><div class="language- line-numbers-mode"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki one-dark-pro vp-code" tabindex="0"><code><span class="line"><span>### Hi there 👋</span></span>
<span class="line"><span>&lt;!--**GULU-H/GULU-H** is a ✨ _special_ ✨ repository because its \`README.md\` (this file) appears on your GitHub profile.</span></span>
<span class="line"><span>Here are some ideas to get you started:</span></span>
<span class="line"><span>- 🔭 I’m currently working on ...- 🌱 I’m currently learning ...- 👯 I’m looking to collaborate on ...- 🤔 I’m looking for help with ...- 💬 Ask me about ...- 📫 How to reach me: ...- 😄 Pronouns: ...- ⚡ Fun fact: ...--&gt;</span></span></code></pre><div class="line-numbers-wrapper" aria-hidden="true"><span class="line-number">1</span><br><span class="line-number">2</span><br><span class="line-number">3</span><br><span class="line-number">4</span><br></div></div><p>默认创建的内容肯定不满足我们需求，接下来看看大佬们都怎么玩的~</p><h3 id="_2-2、引用模板" tabindex="-1">2.2、引用模板 <a class="header-anchor" href="#_2-2、引用模板" aria-label="Permalink to &quot;2.2、引用模板&quot;">​</a></h3><p>Github 上有很多大神改造的模板</p><p><strong>项目 1：awesome-github-profile</strong></p><p>地址：<a href="https://zzetao.github.io/awesome-github-profile" target="_blank" rel="noreferrer">https://zzetao.github.io/awesome-github-profile</a></p><p>该项目提供了丰富的模版，可以从中选择喜爱的模版进行二次开发。</p><p><img src="`+i+'" alt="图片"></p><p><strong>项目 2：Awesome-Profile-README-templates</strong></p><p>地址：<a href="https://github.com/kautukkundan/Awesome-Profile-README-templates" target="_blank" rel="noreferrer">https://github.com/kautukkundan/Awesome-Profile-README-templates</a></p><p>该仓库没有概览图，但是可以进入项目目录点击各 markdown 文件进行查看。</p><p><img src="'+p+'" alt="图片"></p><p><strong>项目 3：gh-profile-readme-generator</strong></p><p>地址：<a href="https://rahuldkjain.github.io/gh-profile-readme-generator/" target="_blank" rel="noreferrer">https://rahuldkjain.github.io/gh-profile-readme-generator/</a></p><p>使用该网站可通过填写表单为你生成 profile，如果懒得二次定制可以使用该网站进行生成。</p><p><img src="'+n+'" alt="图片"></p><h2 id="_3、为内容添加有趣模块" tabindex="-1">3、为内容添加有趣模块 <a class="header-anchor" href="#_3、为内容添加有趣模块" aria-label="Permalink to &quot;3、为内容添加有趣模块&quot;">​</a></h2><p>如果上面选择了一个有趣的模板后，则可以再为内容添加一些小部件</p><h3 id="_3-1、徽章-badge" tabindex="-1">3.1、徽章 badge <a class="header-anchor" href="#_3-1、徽章-badge" aria-label="Permalink to &quot;3.1、徽章 badge&quot;">​</a></h3><p>徽章我们见过很多，其实就是一个 Markdown 图片链接，借助 shields.io 来生成即可</p><p>地址：<a href="https://shields.io/" target="_blank" rel="noreferrer">https://shields.io/</a></p><p><img src="'+l+'" alt="图片"></p><p>这里由于有水印看的效果不太好</p><h3 id="_3-2、waka-时间展示" tabindex="-1">3.2、waka 时间展示 <a class="header-anchor" href="#_3-2、waka-时间展示" aria-label="Permalink to &quot;3.2、waka 时间展示&quot;">​</a></h3><p>地址：<a href="https://github.com/marketplace/actions/waka-readme" target="_blank" rel="noreferrer">https://github.com/marketplace/actions/waka-readme</a></p><p>该项目可以生成一个代码提交图等内容，详情可看官网介绍</p><p><img src="'+h+'" alt="图片"></p><h3 id="_3-3、展示-github-stars-等信息" tabindex="-1">3.3、展示 GitHub stars 等信息 <a class="header-anchor" href="#_3-3、展示-github-stars-等信息" aria-label="Permalink to &quot;3.3、展示 GitHub stars 等信息&quot;">​</a></h3><p>地址：<a href="https://github.com/anuraghazra/github-readme-stats" target="_blank" rel="noreferrer">https://github.com/anuraghazra/github-readme-stats</a></p><p><img src="'+c+'" alt="图片"></p><h3 id="_3-4、github-contributions-贪吃蛇游戏" tabindex="-1">3.4、GitHub contributions 贪吃蛇游戏 <a class="header-anchor" href="#_3-4、github-contributions-贪吃蛇游戏" aria-label="Permalink to &quot;3.4、GitHub contributions 贪吃蛇游戏&quot;">​</a></h3><p>地址：<a href="https://github.com/Platane/snk" target="_blank" rel="noreferrer">https://github.com/Platane/snk</a></p><p>该项目可以根据你的贡献量生成贪吃蛇动画</p><p><img src="'+u+'" alt="图片"></p><h2 id="总结" tabindex="-1">总结 <a class="header-anchor" href="#总结" aria-label="Permalink to &quot;总结&quot;">​</a></h2><p>Github profile 本质上就是对一个 README.md 文件的编辑，所以只要满足 Markdown 语法的内容都可以写进去~</p><p>借助 GitHub profile 可以让我们打造自己个性化的 GitHub 首页，在全球最大男性交友网站中有特色的介绍自己 🐶。</p>',53),m=[d];function g(f,_,k,P,A,G){return t(),e("div",null,m)}const H=a(b,[["render",g]]);export{w as __pageData,H as default};
